import { motion } from "framer-motion";

const Slide = () => {
  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 5 }}
    >
      Hello, world!
    </motion.div>
  );
};

export default Slide;
